import { Card, CardContent, Container, CardHeader } from "@mui/material";
import "./styles.css";

const cardHeaderProps = {
  titleTypographyProps: {
    variant: "h4",
    component: "h4",
    align: "center",
    gutterBottom: true,
    // gutterTop: true,
  },
  subheaderTypographyProps: {
    variant: "h6",
    component: "h6",
    align: "center",
  },
};

function Shell({ heading, content, subheading }) {
  return (
    <Container>
      <Card variant="outlined">
        <CardHeader
          {...cardHeaderProps}
          title={heading}
          subheader={subheading}
        ></CardHeader>
        <CardContent>{content}</CardContent>
      </Card>
    </Container>
  );
}

export default Shell;
